import CountryComponent from './components/CountryComponent';
import Container from './components/Container';

function App() {
  return (
    <>
    <CountryProvider>
      <WeatherProvider>
        <Container />
      </WeatherProvider>
    </CountryProvider>
    </>
  );
}

export default App;
